problem:
A hexagon is inscribed in a circle: [asy]
pair pA, pB, pC, pD, pE, pF, pO;
pO = (0, 0);
pA = pO + dir(-10);
pB = pO + dir(60);
pC = pO + dir(130);
pD = pO + dir(170);
pE = pO + dir(-160);
pF = pO + dir(-80);
draw(pA--pB--pC--pD--pE--pF--pA);
label("$105^\circ$", pF, N * 2);
label("$110^\circ$", pB, SW * 1.5);
label("$\alpha$", pD, E);
draw(circle(pO, 1));
[/asy] What is the measure of $\alpha$, in degrees?

solution:
Labeling our vertices will help a great deal, as will drawing a few radii: [asy]
pair pA, pB, pC, pD, pE, pF, pO;
pO = (0, 0);
pA = pO + dir(-10);
pB = pO + dir(60);
pC = pO + dir(130);
pD = pO + dir(170);
pE = pO + dir(-160);
pF = pO + dir(-80);
draw(pA--pB--pC--pD--pE--pF--pA);
draw(pA--pO--pC--pO--pE--pO, red);
draw(circle(pO, 1));
label("$O$", pO, NE);
label("$A$", pA, E);
label("$B$", pB, NE);
label("$C$", pC, NW);
label("$D$", pD, W);
label("$E$", pE, SW);
label("$F$", pF, S);
label("$105^\circ$", pF, N * 2);
label("$110^\circ$", pB, SW * 1.5);
label("$\alpha$", pD, E);
[/asy] First of all, we see that $\angle ABC = 110^\circ$ must be half of the major arc ${AEC},$ thus arc ${AEC} = 2 \cdot \angle ABC.$ Then, the minor arc ${AC}$ must be $360^\circ - 2 \cdot \angle ABC = 360^\circ - 2 \cdot 110^\circ = 140^\circ.$

Likewise, the minor arc ${EA}$ must be $360^\circ - 2 \cdot \angle EFA = 360^\circ - 2 \cdot 105^\circ = 150^\circ,$ and the minor arc ${CE}$ is $360^\circ - 2 \alpha.$ Now, arc ${AC},$ ${CE},$ and ${EA}$ must add up to $360^\circ,$ which means that \begin{align*}
360^\circ &= (360^\circ - 2 \alpha) + 140^\circ + 150^\circ\\
360^\circ &= 650^\circ - 2\alpha\\
2\alpha &= 290^\circ\\
\alpha &= \boxed{145^\circ}.
\end{align*}

Let the number of left-handed boys be $x$.  Since there are four times as many right-handed boys, the number of right-handed boys is $4x$.  Since there are twice as many left-handed girls as left-handed boys, and there are $x$ left-handed boys, there are $2x$ left-handed girls.  We place all of this in a Venn diagram:


[asy]
unitsize(0.05cm);
label("Left-Handed", (2,74));
label("Boys", (80,74));
draw(Circle((30,45), 22));
draw(Circle((58, 45), 22));
label("$x$", (44, 45));
label("Neither (right-handed girls)",(44,10));
label(scale(0.8)*"$2x$",(28,45));
label(scale(0.8)*"$4x$",(63,45));
[/asy]

We also know that half the girls on the team are left-handed.  Since there are $2x$ left-handed girls, there are also $2x$ right-handed girls.


[asy]
unitsize(0.05cm);
label("Left-Handed", (2,74));
label("Boys", (80,74));
draw(Circle((30,45), 22));
draw(Circle((58, 45), 22));
label("$x$", (44, 45));
label("Neither (right-handed girls): $2x$",(44,10));
label(scale(0.8)*"$2x$",(28,45));
label(scale(0.8)*"$4x$",(63,45));
[/asy]

There are a total of  \[36=2x+x+4x+2x=9x\]people on the team, so $x=4$.  We are trying to find the number of right-handed boys.  This number is  \[4x=4\cdot4=\boxed{16}.\]

We see that $(3,-10,1)$ is a point on the first line.

A point on the second line is given by
\[\begin{pmatrix} x \\ y \\ z \end{pmatrix} = \begin{pmatrix} -5 \\ -3 \\ 6 \end{pmatrix} + t \begin{pmatrix} 4 \\ -18 \\ -4 \end{pmatrix} = \begin{pmatrix} -5 + 4t \\ -3 - 18t \\ 6 - 4t \end{pmatrix}.\][asy]
unitsize (0.6 cm);

pair A, B, C, D, E, F, H;

A = (2,5);
B = (0,0);
C = (8,0);
D = (A + reflect(B,C)*(A))/2;

draw(A--D);
draw((0,5)--(8,5));
draw((0,0)--(8,0));

dot("$(3,-10,1)$", A, N);
dot("$(-5 + 4t, -3 - 18t, 6 - 4t)$", D, S);
[/asy]

The vector pointing from $(3,-10,1)$ to $(-5 + 4t, -3 - 18t, 6 - 4t)$ is then
\[\mathbf{v} = \begin{pmatrix} -8 + 4t \\ 7 - 18t \\ 5 - 4t \end{pmatrix}.\]For the point on the second line that is closest to $(3,-10,1),$ this vector will be orthogonal to the direction vector of the second line, which is $\begin{pmatrix} 4 \\ -18 \\ -4 \end{pmatrix}.$  Thus,
\[\begin{pmatrix} -8 + 4t \\ 7 - 18t \\ 5 - 4t \end{pmatrix} \cdot \begin{pmatrix} 4 \\ -18 \\ -4 \end{pmatrix} = 0.\]This gives us $(-8 + 4t)(4) + (7 - 18t)(-18) + (5 - 4t)(-4) = 0.$  Solving, we find $t = \frac{1}{2}.$

Substituting this value into $\mathbf{v},$ we find that the distance between the parallel lines is then
\[\|\mathbf{v}\| = \left\| \begin{pmatrix} -6 \\ -2 \\ 3 \end{pmatrix} \right\| = \boxed{7}.\]

Let $P$ be the point on the unit circle that is $120^\circ$ counterclockwise from $(1,0)$, and let $D$ be the foot of the altitude from $P$ to the $x$-axis, as shown below.

[asy]

pair A,C,P,O,D;

draw((0,-1.2)--(0,1.2),p=black+1.2bp,Arrows(0.15cm));

draw((-1.2,0)--(1.2,0),p=black+1.2bp,Arrows(0.15cm));

A = (1,0);

O= (0,0);

label("$x$",(1.2,0),SE);

label("$y$",(0,1.2),NE);

P = rotate(120)*A;

D = foot(P,A,-A);

draw(O--P--D);

draw(rightanglemark(O,D,P,2));

draw(Circle(O,1));

label("$O$",O,SE);

label("$P$",P,NW);

//label("$A$",A,SE);

label("$D$",D,S);

[/asy]

Triangle $POD$ is a 30-60-90 triangle, so $DO = \frac{1}{2}$ and $DP = \frac{\sqrt{3}}{2}$.  Therefore, the coordinates of $P$ are $\left(-\frac{1}{2}, \frac{\sqrt{3}}{2}\right)$, so $\cos 120^\circ = \boxed{-\frac{1}{2}}$.

Since $MN$ is parallel to $BC$, $\angle MIB = \angle IBC$.  But $BI$ is an angle bisector, so $\angle IBC = \angle IBM$.  Hence, triangle $MIB$ is isosceles with $MI = MB$.  By the same argument, triangle $NIC$ is isosceles, with $NI = NC$.

[asy]
import geometry;

unitsize(1 cm);

pair A, B, C, I, M, N;

A = (1,3);
B = (0,0);
C = (4,0);
I = incenter(A,B,C);
M = extension(I, I + B - C, A, B);
N = extension(I, I + B - C, A, C);

draw(A--B--C--cycle);
draw(B--I--C);
draw(M--N);

label("$A$", A, dir(90));
label("$B$", B, SW);
label("$C$", C, SE);
label("$I$", I, dir(90));
label("$M$", M, NW);
label("$N$", N, NE);
[/asy]

Therefore, the perimeter of triangle $AMN$ is simply \begin{align*}
AM + AN + MN &= AM + AN + MI + NI \\
&= AM + AN + MB + NC \\
&= (AM + MB) + (AN + NC) \\
&= AB + AC \\
&= 17 + 24 \\
&= \boxed{41}.
\end{align*}

problem:
In rectangle $ABCD$ with $AB = 16,$ $P$ is a point on $BC$ so that $\angle APD=90^{\circ}$. $TS$ is perpendicular to $BC$ with $BP=PT$, as shown.  $PD$ intersects $TS$ at $Q$.  Point $R$ is on $CD$ such that $RA$ passes through $Q$.  In $\triangle PQA$, $PA=20$, $AQ=25$ and $QP=15$. [asy]
size(7cm);defaultpen(fontsize(9));
real sd = 7/9 * 12;
path extend(pair a, pair b) {return a--(10 * (b - a));}

// Rectangle
pair a = (0, 0); pair b = (0, 16); pair d = (24 + sd, 0); pair c = (d.x, b.y);
draw(a--b--c--d--cycle);
label("$A$", a, SW);label("$B$", b, NW);label("$C$", c, NE);label("$D$", d, SE);

// Extra points and lines
pair q = (24, 7); pair s = (q.x, 0); pair t = (q.x, b.y);
pair r = IP(c--d, extend(a, q));
pair p = (12, b.y);
draw(q--a--p--d--r--cycle);draw(t--s);
label("$R$", r, E); label("$P$", p, N);label("$Q$", q, 1.2 * NE + 0.2 * N);label("$S$", s, S); label("$T$", t, N);

// Right angles and tick marks
markscalefactor = 0.1;
draw(rightanglemark(a, b, p)); draw(rightanglemark(p, t, s)); draw(rightanglemark(q, s, d));draw(rightanglemark(a, p, q));
add(pathticks(b--p, 2, spacing=3.4, s=10));add(pathticks(p--t, 2, spacing=3.5, s=10));

// Number labels
label("$16$", midpoint(a--b), W); label("$20$", midpoint(a--p), NW); label("$15$", midpoint(p--q), NE);
label("$25$", midpoint(a--q), 0.8 * S + E);
[/asy] Find $QR - RD$.

solution:
Let us draw a diagram first: [asy]
pair pA, pB, pC, pD;
pD = (0, 0);
pC = pD + dir(0);
pB = pD + dir(180);
pA = pD + dir(100);
draw(pA--pB--pC--pA);
draw(pA--pD);
label("$A$", pA, N);
label("$B$", pB, SW);
label("$C$", pC, SE);
label("$D$", pD, S);
[/asy] As we have isosceles triangles $\triangle ABD$ and $\triangle ACD,$ let us have $\angle ABC = a$ and $\angle ACB = b.$ Then, $\angle BAC =\angle BAD + \angle DAC = a + b.$ Since the three angles must sum to $180^\circ,$ we have that $2(a + b) = 180^\circ,$ so $a + b = 90^\circ.$ Since we know that $a = 50^\circ,$ we see that $b = \angle ACB = \boxed{40^\circ}.$

We let the $x$-axis represent the time Alice arrives at the party, and we let the $y$-axis represent the time Bob arrives at the party. Then we shade in the area where the number of minutes Alice is late for the party plus the number of minutes Bob is late for the party is less than 45.

[asy]
draw((0,0)--(0,60));
draw((0,60)--(60,60)--(60,0));
draw((0,0)--(60,0));
label("5:00", (0,0), SW);
label("6:00", (0,60), W);
label("6:00", (60,0), S);

fill((0,0)--(45,0)--(0,45)--cycle, gray(.7));
[/asy]

If we let 1 unit be one minute, the area of the shaded region is $\frac{45^2}{2}$ square units and the whole area is 3600 square units. Therefore, the probability that a randomly chosen point will land in the shaded region is $\frac{45^2}{2\cdot 3600}=\boxed{\frac{9}{32}}$.

For a fixed value of $y$, the values of $\sin x$ for which $\sin^2 x-\sin x\sin y+\sin^2 y=\frac{3}{4}$ can be determined by the quadratic formula. Namely, \[
\sin x=\frac{\sin y\pm\sqrt{\sin^2 y-4(\sin^2 y-\frac{3}{4})}}{2}
=\frac{1}{2}\sin y\pm\frac{\sqrt{3}}{2}\cos y.
\]Because $\cos \displaystyle\left(\frac{\pi}{3}\displaystyle\right) = \frac{1}{2}$ and $\sin \displaystyle\left(\frac{\pi}{3}\displaystyle\right) = \frac{\sqrt{3}}{2}$, this implies that \[
\sin x=\cos\displaystyle\left(\frac{\pi}{3}\displaystyle\right)\sin y\pm\sin \displaystyle\left(\frac{\pi}{3}\displaystyle\right)\cos y=\sin\displaystyle\left(y\pm\frac{\pi}{3}\displaystyle\right).
\]Within $S$, $\sin x=\sin(y-\frac{\pi}{3})$ implies $x=y-\frac{\pi}{3}$. However, the case $\sin
x=\sin(y+\frac{\pi}{3})$ implies $x=y+\frac{\pi}{3}$ when $y\leq\frac{\pi}{6}$, and $x=-y+\frac{2\pi}{3}$ when $y\geq\frac{\pi}{6}$. Those three lines divide the region $S$ into four subregions, within each of which the truth value of the inequality is constant. Testing the points $(0,0)$, $(\frac{\pi}{2},0)$, $(0,\frac{\pi}{2})$, and $(\frac{\pi}{2},\frac{\pi}{2})$ shows that the inequality is true only in the shaded subregion. The area of this subregion is \[
\displaystyle\left(\frac{\pi}{2}\displaystyle\right)^2-\frac{1}{2}\cdot\displaystyle\left(\frac{\pi}{3}\displaystyle\right)^2-
2\cdot\frac{1}{2}\cdot\displaystyle\left(\frac{\pi}{6}\displaystyle\right)^2=\boxed{\frac{\pi^2}{6}}.
\][asy]
unitsize(3cm);
draw((0,0)--(1,0)--(1,1)--(0,1)--cycle,dashed);
fill((0,0.66)--(0.33,1)--(1,0.33)--(0.66,0)--(0,0)--cycle,gray(0.7));
dot((0,0));

dot((0,1));
dot((1,1));
dot((1,0));
dot((0.66,0));
dot((0,0.66));
dot((0.33,1));
dot((1,0.33));
draw((0,0.66)--(0.33,1)--(1,0.33)--(0.66,0),linewidth(0.7));
label("$(0,0)$",(0,0),W);
label("$(0,\frac{\pi}{2})$",(0,1),W);
label("$(\frac{\pi}{2},0)$",(1,0),E);
label("$(\frac{\pi}{2}, \frac{\pi}{2})$",(1,1),E);
draw((1.1,0.43)--(0.56,-0.1),linewidth(0.7));
draw((1.1,0.23)--(0.23,1.1),linewidth(0.7));
draw((-0.1,0.56)--(0.43,1.1),linewidth(0.7));
label("$x=y+\frac{\pi}{3}$",(1.1,0.43),E);
label("$x=y-\frac{\pi}{3}$",(0.43,1.1),NE);
label("$x=-y+\frac{2\pi}{3}$",(0.23,1.1),NW);
[/asy]

problem:
In the figure, square $WXYZ$ has a diagonal of 12 units. Point $A$ is a midpoint of segment $WX$, segment $AB$ is perpendicular to segment $AC$ and $AB = AC.$ What is the length of segment $BC$? [asy]
import olympiad; size(150); defaultpen(linewidth(0.8));

draw(unitsquare);
draw((2,0)--(0.5,0)--(0.5,1.5)--cycle);
label("$W$",(0,0),W); label("$X$",(1,0),S); label("$Y$",(1,1),E); label("$Z$",(0,1),W);
label("$A$",(0.5,0),S); label("$B$",(2,0),E); label("$C$",(0.5,1.5),N);
[/asy]

solution:
Triangles WXY and BXY are isosceles triangles that have a leg in common, so they are congruent.  Therefore segment $YB$ is equal to a diagonal of square $WXYZ$, so its length is 12 units. By adding point $D$, as shown, we can see that triangles $CDY$ and $YXB$ are similar to triangle $CAB$. This also means that triangle $CDY$ is similar to triangle $YXB$. Since the sides of two similar triangles are related by a constant factor, and we can see that the length of $DY$ is 1/2 the length of $XB$, we know that the length of $CY$ must be $(1/2)(12) = 6$ units. Thus, the length of CB is $12 + 6 = \boxed{18\text{ units}}$. [asy]
import olympiad; size(150); defaultpen(linewidth(0.8));
draw(unitsquare);
draw((2,0)--(0.5,0)--(0.5,1.5)--cycle);
label("$W$",(0,0),W); label("$X$",(1,0),S); label("$Y$",(1,1),E); label("$Z$",(0,1),W);
label("$A$",(0.5,0),S); label("$B$",(2,0),E); label("$C$",(0.5,1.5),N);
label("$D$",(0.5,1),NW);
[/asy]

