label("$A$",A,W); label("$B$",B,N); label("$C$",C,E);
[/asy]

solution:
Drawing altitude $\overline{BD}$ splits $\triangle ABC$ into 30-60-90 triangle $ABD$ and 45-45-90 triangle $BCD$:

[asy]
import olympiad; size(200); import geometry; import graph; defaultpen(linewidth(0.8));
pair A = origin, B = (10*sqrt(3),10), C = (10*sqrt(3) + 10,0);
draw(Label("$20$",align=NW),A--B); draw(B--C); draw(A--C);
label("$A$",A,W); label("$B$",B,N); label("$C$",C,E);
pair D = (10*sqrt(3),0);
label("$D$",D,S);
draw(B--D);
draw(rightanglemark(B,D,A,40));
[/asy]

From 30-60-90 triangle $ABD$, we have $BD = AB/2 = 10$.  From 45-45-90 triangle $BCD$, we have $BC = BD\sqrt{2} = \boxed{10\sqrt{2}}$.

By Pythagoras, $\angle C = 90^\circ$.  Triangles $ACD$ and $ABC$ are similar, so \[CD = BC \cdot \frac{AC}{AB} = 15 \cdot \frac{8}{17} = \frac{120}{17},\]and \[AD = AC \cdot \frac{AC}{AB} = 8 \cdot \frac{8}{17} = \frac{64}{17}.\][asy]
unitsize(0.4 cm);

pair A, B, C, D;

A = (0,8);
B = (15,0);
C = (0,0);
D = (C + reflect(A,B)*(C))/2;

draw(A--B--C--cycle);
draw(C--D);

label("$A$", A, NW);
label("$B$", B, SE);
label("$C$", C, SW);
label("$D$", D, NE);
[/asy]

Therefore, the area of triangle $ACD$ is \[\frac{1}{2} \cdot AD \cdot CD = \frac{1}{2} \cdot \frac{64}{17} \cdot \frac{120}{17} = \boxed{\frac{3840}{289}}.\]

Rotating $360^\circ$ is the same as doing nothing, so rotating $600^\circ$ is the same as rotating $600^\circ - 360^\circ = 240^\circ$.  Therefore, we have $\sin 600^\circ = \sin (600^\circ - 360^\circ) = \sin 240^\circ$.

Let $P$ be the point on the unit circle that is $240^\circ$ counterclockwise from $(1,0)$, and let $D$ be the foot of the altitude from $P$ to the $x$-axis, as shown below.

