A right hexagonal prism has a height of 3 feet and each edge of the hexagonal bases is 6 inches. What is the sum of the areas of the non-hexagonal faces of the prism, in square feet?

[asy]import three;

currentprojection=orthographic(1/2,-1,1/2);

draw((0,0,0)--(1,0,0)--(1.5,0.86,0)--(1,1.72,0)--(0,1.72,0)--(-0.5,0.86,0)--cycle);

draw((0,0,6)--(1,0,6)--(1.5,0.86,6)--(1,1.72,6)--(0,1.72,6)--(-0.5,0.86,6)--cycle);

draw((0,0,0)--(0,0,6));

draw((1,0,0)--(1,0,6));

draw((1.5,0.86,0)--(1.5,0.86,6));

draw((1,1.72,0)--(1,1.72,6));

draw((0,1.72,0)--(0,1.72,6));

draw((-0.5,0.86,0)--(-0.5,0.86,6));

[/asy]

solution:
By the sum of cubes factorization, \[z^9 - 1 = (z^6+z^3+1)(z^3-1).\]The roots of $z^9 - 1$ are the nine $9^{\text{th}}$ roots of unity, and the roots of $z^3 - 1$ are the three $3^{\text{th}}$ roots of unity. It follows that the roots of $z^6 + z^3 + 1$ are the six other roots of $z^9 - 1$: that is, the six $9^{\text{th}}$ roots of unity which are not $3^{\text{rd}}$ roots of unity.

The arguments of the ninth roots of unity in the complex plane are $0^\circ, 40^\circ, 80^\circ, \dots, 320^\circ.$

[asy]
unitsize(2 cm);

draw((-1.5,0)--(1.5,0));
draw((0,-1.5)--(0,1.5));
draw(Circle((0,0),1));

dot("$0^\circ$", (1,0), NE, red);
dot("$40^\circ$", dir(40), dir(40));
dot("$80^\circ$", dir(80), dir(80));
dot("$120^\circ$", dir(120), dir(120), red);
dot("$160^\circ$", dir(160), dir(160));
dot("$200^\circ$", dir(200), dir(200));
dot("$240^\circ$", dir(240), dir(240), red);
dot("$280^\circ$", dir(280), dir(280));
dot("$320^\circ$", dir(320), dir(320));
[/asy]

The two possible arguments that lie between $90^\circ$ and $180^\circ$ are $120^\circ$ and $160^\circ,$ but the root with argument $120^\circ$ is a third root of unity as well. Therefore, the correct argument is $160^\circ,$ and the answer is $\boxed{160}.$

problem:
Three semicircles of radius 1 are constructed on diameter $\overline{AB}$ of a semicircle of radius 2. The centers of the small semicircles divide $\overline{AB}$  into four line segments of equal length, as shown. What is the area of the shaded region that lies  within the large semicircle but outside the smaller semicircles? Express your answer in terms of $\pi$ and in simplest radical form.

[asy]
fill((0,2)..(2,0)--(-2,0)..cycle,gray(0.7));
fill((-1,1)..(0,0)--(-2,0)..cycle,white);
fill((1,1)..(0,0)--(2,0)..cycle,white);
fill((0,1)..(1,0)--(-1,0)..cycle,white);
draw((0,1)..(1,0)--(-1,0)..cycle,dashed);
draw((0,2)..(2,0)--(-2,0)..cycle);
label("$A$",(-2,0),W);
label("$B$",(2,0),E);
label("1",(-1.5,0),S);
label("2",(0,0),S);
label("1",(1.5,0),S);
dot((0,0));
dot((-1,0));
dot((1,0));
draw((-2,-0.1)--(-2,-0.4));
draw((-1,-0.1)--(-1,-0.4));
draw((2,-0.1)--(2,-0.4));
draw((1,-0.1)--(1,-0.4));
[/asy]

solution:
The area of the larger semicircle is \[
\frac{1}{2}\pi \cdot (2)^2 = 2\pi.
\] The region deleted from the larger semicircle consists of five congruent sectors and two equilateral triangles. The area of each of the sectors is \[
\frac{1}{6}\pi \cdot (1)^2 = \frac{\pi}{6}
\] and the area of each triangle is \[
\frac{1}{2}\cdot 1\cdot \frac{\sqrt{3}}{2} = \frac{\sqrt{3}}{4},
\] so the area of the shaded region is \[
2\pi - 5\cdot\frac{\pi}{6}-2\cdot\frac{\sqrt{3}}{4} = \boxed{\frac{7}{6}\pi - \frac{\sqrt{3}}{2}}.
\] [asy]
fill((0,2)..(2,0)--(-2,0)..cycle,gray(0.7));
fill((-1,1)..(0,0)--(-2,0)..cycle,white);
fill((1,1)..(0,0)--(2,0)..cycle,white);
fill((0,1)..(1,0)--(-1,0)..cycle,white);
draw((0,1)..(1,0)--(-1,0)..cycle,dashed);
draw((0,2)..(2,0)--(-2,0)..cycle);
label("$A$",(-2,0),W);
label("$B$",(2,0),E);
label("1",(-1.5,0),S);
label("1",(-0.5,0),S);
label("1",(0.5,0),S);
draw((-1.5,0.87)--(-1,0)--(-0.5,0.87)--(0,0)--(0.5,0.87)--(1,0)--(1.5,0.87),linewidth(0.7));
label("1",(1.5,0),S);
dot((0,0));
dot((-1,0));
dot((1,0));
draw((-2,-0.1)--(-2,-0.4));
draw((-1,-0.1)--(-1,-0.4));
draw((2,-0.1)--(2,-0.4));
draw((1,-0.1)--(1,-0.4));
draw((0,-0.1)--(0,-0.4));
[/asy]

To begin, consider the number of ways to arrange the three countries around the circle.  We can consider the English representatives a block, the Germans another block, and the French a third block.  There are $(3-1)!=2$ ways to arrange these three blocks around a circle.  We can also see this by simply drawing the two possible arrangements: [asy]
label("E",(0,0));
label("F",(-.75,-1));
label("G",(.75,-1));
label("E",(3,0));
label("F",(3.75,-1));
label("G",(2.25,-1));
[/asy] Within the English group, there are $3!=6$ ways to arrange the three representatives.  Similarly, there are $4!$ ways to arrange the Germans and $2!$ ways to arrange the French representatives.  Overall, the total number of ways to seat the 9 representatives is: $$2!\times3!\times4!\times2!=2\times6\times24\times2=\boxed{576}$$

problem:
A line has slope $-\frac{7}{4}.$  Which of the following vectors are possible direction vectors for the line?

[asy]
usepackage("amsmath");

unitsize(1 cm);

pair x = (3,0), y = (0,2);

label("(A) $\begin{pmatrix} 4 \\ 7 \end{pmatrix}$", y);
label("(B) $\begin{pmatrix} 7 \\ 4 \end{pmatrix}$", x + y);
label("(C) $\begin{pmatrix} -4/7 \\ 1 \end{pmatrix}$", 2*x + y);
label("(D) $\begin{pmatrix} 1 \\ 7/4 \end{pmatrix}$", 3*x + y);
label("(E) $\begin{pmatrix} 14 \\ -8 \end{pmatrix}$", (0,0));
label("(F) $\begin{pmatrix} -12 \\ 21 \end{pmatrix}$", x);
label("(G) $\begin{pmatrix} -2 \\ -7/2 \end{pmatrix}$", 2*x);
label("(H) $\begin{pmatrix} -1/3 \\ 7/12 \end{pmatrix}$", 3*x);
[/asy]

Enter the letters of the correct options, separated by commas.

solution:
Since the slope of the line is $-\frac{7}{4},$ the line falls 7 units vertically for every 4 horizontal units.  Thus, a possible direction vector is $\begin{pmatrix} 4 \\ -7 \end{pmatrix}.$

[asy]
unitsize(0.5 cm);

pair A, B, C;

A = (0,0);
B = (4,0);
C = (4,-7);

draw(A--B--C);
draw(A--C,red,Arrow(6));

label("$4$", (A + B)/2, N);
label("$7$", (B + C)/2, E);
[/asy]

This means any nonzero scalar multiple of $\begin{pmatrix} 4 \\ -7 \end{pmatrix}$ is a possible direction vector.  The possible options are then $\boxed{\text{C, F, H}}.$

Let $P$ be the point on the unit circle that is $330^\circ$ counterclockwise from $(1,0)$, and let $D$ be the foot of the altitude from $P$ to the $x$-axis, as shown below.

[asy]
pair A,C,P,O,D;
draw((0,-1.2)--(0,1.2),p=black+1.2bp,Arrows(0.15cm));
draw((-1.2,0)--(1.2,0),p=black+1.2bp,Arrows(0.15cm));
A = (1,0);
O= (0,0);
label("$x$",(1.2,0),SE);
label("$y$",(0,1.2),NE);

P = rotate(330)*A;
D = foot(P,A,-A);
draw(O--P--D);
draw(rightanglemark(O,D,P,2));
draw(Circle(O,1));
label("$O$",O,NW);
label("$P$",P,SE);
//label("$A$",A,SE);
label("$D$",D,N);
[/asy]

Triangle $POD$ is a 30-60-90 triangle, so $DO = \frac{\sqrt{3}}{2}$ and $PD = \frac{1}{2}$.  Therefore, the coordinates of $P$ are $\left(\frac{\sqrt{3}}{2},-\frac{1}{2}\right)$, so $\tan 330^\circ = \frac{\sin330^\circ}{\cos 330^\circ} = \frac{-1/2}{\sqrt{3}/2} = -\frac{1}{\sqrt{3}} = \boxed{-\frac{\sqrt{3}}{3}}$.

We draw a regular hexagon and one of its longest diagonals: [asy]
size(80);
draw((0,0)--(1,0)--(1.5,.5*sqrt(3))--(1,sqrt(3))--(0,sqrt(3))--(-.5,.5*sqrt(3))--cycle);
draw((1,0)--(0,sqrt(3)));
[/asy] Now we draw in the other two long diagonals.  We have split the hexagon into six equilateral triangles, which are congruent by symmetry.  [asy]
size(80);
draw((0,0)--(1,0)--(1.5,.5*sqrt(3))--(1,sqrt(3))--(0,sqrt(3))--(-.5,.5*sqrt(3))--cycle);
draw((1,0)--(0,sqrt(3))); draw((1.5,.5*sqrt(3))--(-.5,.5*sqrt(3))); draw((1,sqrt(3))--(0,0));
[/asy] We see that two side lengths make up one long diagonal.  Let the hexagon's side length be $s$, then, its long diagonal has length $2s$ and its perimeter has length $6s$.  The ratio of its long diagonal to its perimeter is hence $\frac{2s}{6s}=\boxed{\frac{1}{3}}$.

Let $D,$ $E,$ and $F$ be the points corresponding to $-\overrightarrow{A} + \overrightarrow{B} + \overrightarrow{C},$ $\overrightarrow{A} - \overrightarrow{B} + \overrightarrow{C},$ and $\overrightarrow{A} + \overrightarrow{B} - \overrightarrow{C},$ respectively.

[asy]
unitsize(0.4 cm);

pair A, B, C, D, E, F;

A = (2,4);
B = (0,0);
C = (7,0);
D = -A + B + C;
E = A - B + C;
F = A + B - C;

draw(A--B--C--cycle);
draw(D--E--F--cycle,dashed);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, S);
label("$E$", E, NE);
label("$F$", F, NW);
[/asy]

Then
\[\frac{\overrightarrow{E} + \overrightarrow{F}}{2} = \frac{(\overrightarrow{A} - \overrightarrow{B} + \overrightarrow{C}) + (\overrightarrow{A} + \overrightarrow{B} - \overrightarrow{C})}{2} = \overrightarrow{A},\]so $A$ is the midpoint of $\overline{EF}.$  Similarly, $B$ is the midpoint of $\overline{DF},$ and $C$ is the midpoint of $\overline{DE},$ so the area of triangle $ABC$ is $\frac{1}{4}$ the area of triangle $DEF.$  In other words, the area of triangle $DEF$ is $4 \cdot 12 = \boxed{48}.$

problem:
Each triangle in this figure is an isosceles right triangle. The length of $\overline{BC}$ is 2 units. What is the number of units in the perimeter of quadrilateral $ABCD$? Express your answer in simplest radical form.

[asy]
draw((0,0)--(10,0)--(0,10)--cycle);
draw((10,0)--(0,10)--(10,20)--cycle);
draw((1,0)--(1,1)--(0,1));
draw((1,11)--(2,10)--(1,9));
label("$A$",(0,0),S);
label("$B$",(10,0),S);
label("$C$",(10,20),N);
label("$D$",(0,10),W);

[/asy]

solution:
By the angle bisector theorem, $AC/CD = AB/BD = 105/42 = 5/2$.  Let $AC = 5x$ and $CD = 2x$.

[asy]
unitsize(0.03 cm);

pair A, B, C, D;

A = (0,105);
B = (0,0);
C = (100,0);
D = (42,0);

draw(A--B--C--cycle);
draw(A--D);

label("$A$", A, NW);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, S);
label("$42$", (B + D)/2, S);
label("$105$", (A + B)/2, W);
label("$2x$", (C + D)/2, S);
label("$5x$", (A + C)/2, NE);
[/asy]

Then by Pythagoras, $(2x + 42)^2 + 105^2 = (5x)^2$.  This simplifies to $21x^2 - 168x - 12789 = 0$, which factors as $21(x - 29)(x + 21) = 0$, so $x = 29$.  Therefore, $AC = 5x = \boxed{145}$.

problem:
On a protractor, ray $BA$ goes through the 85-degree mark and ray $BC$ goes through the 30-degree mark. What is the measure, in degrees, of angle $ABC$?

[asy]
draw((0,0)--(2,0)..(1,1)..(0,0)..cycle,linewidth(2));

draw((1,0)--1.4dir(30)+(1,0),Arrow);
draw((1,0)--1.3dir(85)+(1,0),Arrow);

dot(1.1dir(85)+(1,0));
dot(1.2dir(30)+(1,0));

label("A",1.1dir(85)+(1,0),NW);
label("B",(1,0),S);
label("C",1.2dir(30)+(1,0),SE);

label("85",.9dir(85)+(1,0));
label("30",.9dir(30)+(1,0));

[/asy]

solution:
First, notice $2x - xy = x(2 - y)$. So this problem reduces to finding the values of $x$ and $y$.

Add the two equations together to find $x$: \begin{align*}
2x &= 20, \\
x &= 10.
\end{align*}
Subtract the two equations to find $y$: \begin{align*}
2y &= 4, \\
y &= 2.
\end{align*}
Since $y = 2$ and $x = 10$, $x(2 - y) = 10(2 - 2) = \boxed{0}$.

problem:
A cube of edge length $s > 0$ has the property that its surface area is equal to the sum of its volume and five times its edge length. Compute the sum of all possible values of $s$.

[asy]

size(5cm,5cm);

pair A,B,C,D,E,F,G,H;

A=(0,0);
B=(1,0);
C=(1,1);
D=(0,1);
E=(0.3,1.5);
F=C+(E-D);
G=B+(E-D);
H=A+(E-D);

draw(A--B--C--D--A--H--E);
draw(D--C--F);
draw(H--G);
draw(D--E--F--G--B);

dot(A);
dot(B);
dot(C);
dot(D);
dot(E);
dot(F);
dot(G);
dot(H);

[/asy]

solution:
Let $s$ be the side length of the cube.  Then the only possible distances of between two vertices of the cube are $s,$ $s \sqrt{2},$ and $s \sqrt{3}.$

[asy]
import graph;

unitsize(3 cm);

draw((0,0)--(1,0)--(1,1)--(0,1)--cycle);
draw((1,0)--(1.3,0.3));
draw((1,1)--(1.3,1.3));
draw((0,1)--(0.3,1.3));
draw((1.3,0.3)--(1.3,1.3)--(0.3,1.3));
draw((0,0)--(0.3,0.3),dashed);
draw((0.3,0.3)--(1.3,0.3),dashed);
draw((0.3,0.3)--(0.3,1.3),dashed);
draw((1.3,1.3)--(0,1));
draw((0,1)--(1.3,0.3),dashed);

label("$s$", ((1.3,1.3) + (1.3,0.3))/2, E, red);
label("$s \sqrt{2}$", ((1.3,1.3) + (0,1))/2, NW, red);
label("$s \sqrt{3}$", ((0,1) + (1.3,0.3))/2, SW, red);
[/asy]

Since $AB = 2 \sqrt{6},$ $BC = 4 \sqrt{3},$ and $AC = 6 \sqrt{2},$ and
\[2 \sqrt{6} < 4 \sqrt{3} < 6 \sqrt{2},\]they must be equal to $s,$ $s \sqrt{2},$ and $s \sqrt{3},$ respectively.  Furthermore, the only lengths of $s \sqrt{3}$ are space diagonals of the cube.

This means that $\overline{AC}$ is a space diagonal of the cube, so the center of the cube is the midpoint of $\overline{AC},$ which is $\boxed{(3,2,4)}.$

problem:
Below is a portion of the graph of a function, $y=h(x)$:

[asy]
import graph; size(8cm); real lsf=0.5; pen dps=linewidth(0.7)+fontsize(10); defaultpen(dps); pen ds=black; real xmin=-0.75,xmax=8.25,ymin=-1.25,ymax=10.25;

pen cqcqcq=rgb(0.75,0.75,0.75);

/*grid*/ pen gs=linewidth(0.7)+cqcqcq+linetype("2 2"); real gx=1,gy=1;
for(real i=ceil(xmin/gx)*gx;i<=floor(xmax/gx)*gx;i+=gx) draw((i,ymin)--(i,ymax),gs); for(real i=ceil(ymin/gy)*gy;i<=floor(ymax/gy)*gy;i+=gy) draw((xmin,i)--(xmax,i),gs);

Label laxis; laxis.p=fontsize(10);

xaxis("",xmin,xmax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true); yaxis("",ymin,ymax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true);
real f1(real x){return (x-0.5)*(x-2.5)*(x-6.5)*(x-7.5)/16+x;}
draw(graph(f1,-0.25,8.25),linewidth(1));
clip((xmin,ymin)--(xmin,ymax)--(xmax,ymax)--(xmax,ymin)--cycle);
label("$y=h(x)$",(8.5,8),E);
[/asy]

What is the sum of all integers $x$ in the interval shown ($0\le x\le 8$) such that $h(x)>x$ ?

solution:
We could check $h(x)$ separately for each integer $x$ from $0$ to $8$: for example, $h(0)\approx 3.8$, so $h(0)>0$, but $h(1)\approx -0.7$, so $h(1)\not>1$, and so on.

However, it is easier to see at a glance which $x$ satisfy $h(x)>x$ by superimposing a graph of $y=x$ on the graph of $y=h(x)$:

[asy]
draw((-0.75,-0.75)--(8.25,8.25),red+1);
import graph; size(8cm); real lsf=0.5; pen dps=linewidth(0.7)+fontsize(10); defaultpen(dps); pen ds=black; real xmin=-0.75,xmax=8.25,ymin=-1.25,ymax=10.25;

pen cqcqcq=rgb(0.75,0.75,0.75);

/*grid*/ pen gs=linewidth(0.7)+cqcqcq+linetype("2 2"); real gx=1,gy=1;
for(real i=ceil(xmin/gx)*gx;i<=floor(xmax/gx)*gx;i+=gx) draw((i,ymin)--(i,ymax),gs); for(real i=ceil(ymin/gy)*gy;i<=floor(ymax/gy)*gy;i+=gy) draw((xmin,i)--(xmax,i),gs);

Label laxis; laxis.p=fontsize(10);

xaxis("",xmin,xmax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true); yaxis("",ymin,ymax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true);
real f1(real x){return (x-0.5)*(x-2.5)*(x-6.5)*(x-7.5)/16+x;}
draw(graph(f1,-0.25,8.25),linewidth(1));
clip((xmin,ymin)--(xmin,ymax)--(xmax,ymax)--(xmax,ymin)--cycle);
label("$y=h(x)$",(8.5,8),E);
dot((0,0),blue); dot((3,3),blue); dot((4,4),blue); dot((5,5),blue); dot((6,6),blue); dot((8,8),blue);
[/asy]

The six blue dots above mark the integer points $(x,x)$ which lie below the graph of $y=h(x)$, indicating that $h(x)>x$. Their $x$-coordinates are $0,3,4,5,6,8,$ which add up to $\boxed{26}$.
